  description:
    '<p style=\'margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, Verdana, "Helvetica Neue", Helvetica, sans-serif; font-size: 11px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\'><span style="color:#000000;"><span style="font-size:16px;"></span><span style="font-size:20px;"><strong>Features:</strong></span><span style="font-size:16px;"><br>\n<strong>Stylish All in One Player：</strong><br>\nThe iAUDIO U7 is a USB storage device, MP3 player, recorder, and FM radio all in a single device. The iAUDIO U7 is an all-in-one player that satisfies both practicality and design in a stylish, compact size.<br>\n<strong><br>\nWireless All-in-One USB MP3 Player ：</strong><br>\nSimply plug the iAUDIO U7 into your PC whether you\'re transferring data or recharging. USB storage and an MP3 player have been combined to maximize convenience without the need for fussy cables.<br>\n<strong><br>\nEasy Voice Recording And Voice Recorder:</strong><br>\nThe built-in microphone allows you to record sound at important moments in any place and time. You can easily record an important meeting or conference. All audio files are recorded in WAV format and saved in Recordings folder.<br>\n<br>\n<strong>Support FM Radio &amp; FM Recording:</strong><br>\nThe iAUDIO U7\'s FM radio allows you to listen to the radio not only in Korea but the US, Japan, China, and Europe as well. You can automatically search for high-sensitivity channels and easily access frequently-used channels by storing them as favorites. What\'s more, the FM radio recording function allows you to record your favorite music or radio broadcasts for immediate playback.<br>\n<br>\n<strong>Support Diverse Types of Codec：</strong><br>\niAUDIO U7 not only supports MP3, WMA, OGG but also supports lossless formats such as FLAC, WAV to offer the full spectrum of high quality sound formats.<br>\n<br>\n<strong>Repeat a Designated Range：</strong><br>\nUse it to study by repetition more effectively, including listening and memorization. You can also listen to a specific section by setting the desired repeat interval and number of repeats.<br>\n<br>\n<strong>Various Equalizers Optimized by Music Genre：</strong><br>\nSix genres - Rock, Funk, Hip Hop, Jazz, Classic, and Techno - optimized EQ settings are provided by default, and you can even set a custom user EQ suited to your own tastes.<br>\n<br>\n </span><span style="font-size:16px;"><br>\n<span style="color:#000000;"><span style="font-size:20px;"><strong>Parameter:</strong></span></span><br>\nColor: gold, black<br>\nProduct capacity: 16GB/32GB<br>\nDisplay: 0.91" OLED (128*32 dot matrix)<br>\nButton: POWER, PLAY/PAUSE/HOLD, HOME, FF, REW, VOL+, VOL-<br>\nFrequency response range: 20Hz~20kHz<br>\nOutput: stereo, left 27mW, right 27mW (16Ω headphones)<br>\nSNR: 95dB<br>\nFile format: FLAC/WAW/MP3/WMA/OGG<br>\n<br>\n<br>\n<strong>Audio coding:</strong><br>\nFKLAC: compression level 0~8, 44.1kHz<br>\nWAV: 48kHz, 16bit<br>\nMP3: MPEG1/2/2.5Layer3, ~320kbps, ~48kHz<br>\nWMA: ~320kbps, ~48kHz<br>\nOGG: ~320kbps, ~44.1kHz<br>\nID3 Tag: ID3 V1, ID2 V2.2/V2.3<br>\nRecording: MIC/FM broadcast<br>\nFM broadcast: Frequency response range: 88~108MHz, 76~108MHz<br>\nBattery: lithium polymer battery<br>\nPlay time: Music: about 15.5H<br>\nCharging time: about 1H (5V500mA)<br>\nOS: windows8/7/Vista/XP/2000/ME: full-featured support<br>\nMAC OS10.x/Linux v2.4 or higher: only supports file transfer<br>\nUSB Port: USB2.0High Speed (recommended configuration)</span></span></p>\n',
